  return (
      <div className="App">
          <img src={"https://uploads-ssl.webflow.com/5cd1e68968db65ba07de7bfb/5fee46ab47d282950f001ff1_Jupe%20Lit%20Exterior%20(photo%20credit_%20Sam%20Gezari).jpg"}/>
          <Jumbotron>
  <h1>Hello, world!</h1>
  <p>
    This is a simple hero unit, a simple jumbotron-style component for calling
    extra attention to featured content or information.
  </p>
  <p>
    <Button variant="primary">Learn more</Button>
  </p>
</Jumbotron>
      </div>
  );
}

export default Home;
